function fetchCheckStatus(t){if(t.status>=200&&t.status<300)return t;const e=new Error(t.statusText);throw e.response=t,e}window.loadData=(t=>{const e={method:"GET",headers:new Headers,mode:"cors",cache:"default"};return fetch(t,e).then(fetchCheckStatus).then(function(t){const e=t.headers.get("Content-Type");return e&&-1!==e.indexOf("application/json")?t.json():t.text()}).then(function(t){return t}).catch(()=>{console.error("Something went wrong! Please check url")})});
